measurements.description:
Five flowers on one unstaked 45-cm inflorescence,
 4 buds on a juvenile inflorescence;
 dorsal sepal oblanceloate, slightly rolled edges,
 chartreuse veined burgundy, darker burgundy central vein;
 lateral sepals flat, oblanceolate, chartreuse veined burgundy,
 blushed burgundy basally;
 petals oblanceolate, slightly porrect, chartreuse veined burgundy,
 darker burgundy central vein;

 lip recurved, undulated edges, light yellow, deep burgundy blotches apically,
 diffused pink edges, light pink picotee, keel bright yellow;
 column cream, interior striped burgundy, anther cap white;
 substance medium; texture matte.
